export default {
  columns: [
    { Header: "Name", accessor: "Name", width: "50%" },
    { Header: "Mobile", accessor: "Mobile", width: "30%" },
    { Header: "PAN", accessor: "PAN", width: "30%" },
    { Header: "TaxStatus", accessor: "TaxStatus", width: "30%" },
    { Header: "Email", accessor: "Email", width: "30%" },
    { Header: "CreatedOn", accessor: "CreatedOn", width: "30%" },
    { Header: "UserId", accessor: "UserId", width: "30%" },
    { Header: "BseClientID", accessor: "BseClientID", width: "30%" },
    { Header: "KYC", accessor: "KYC", width: "30%" },
    { Header: "Bank", accessor: "Bank", width: "30%" },
    { Header: "AOF", accessor: "AOF", width: "30%" },
    { Header: "FATCA", accessor: "FATCA", width: "30%" },
    { Header: "Mandate", accessor: "Mandate", width: "30%" },
    { Header: "Action", accessor: "Action", width: "30%" },

    { Header: "Action", accessor: "Action", Cell: ({ value }) => <IdCell id={value} /> },
    {
      Header: "date",
      accessor: "date",
      Cell: ({ value }) => <DefaultCell value={value} />,
    },
    {
      Header: "status",
      accessor: "status",
      Cell: ({ value }) => {
        let status;

        if (value === "paid") {
          status = <StatusCell icon="done" color="success" status="Paid" />;
        } else if (value === "refunded") {
          status = <StatusCell icon="replay" color="dark" status="Refunded" />;
        } else {
          status = <StatusCell icon="close" color="error" status="Canceled" />;
        }

        return status;
      },
    },
    {
      Header: "customer",
      accessor: "customer",
    },
    {
      Header: "product",
      accessor: "product",
      Cell: ({ value }) => {
        const [name, data] = value;

        return (
          <DefaultCell
            value={typeof value === "string" ? value : name}
            suffix={data.suffix || false}
          />
        );
      },
    },
    { Header: "revenue", accessor: "revenue", Cell: ({ value }) => <DefaultCell value={value} /> },
  ],

